<script>
    import axios from 'axios';

    function show(elem, disp = 'block') {
        document.querySelector(elem).style.display = disp;
    }

    function hide(elem) {
        document.querySelector(elem).style.display = 'none';
    }

    function setText(elem, text) {
        document.querySelector(elem).innerText = text;
    }

    export default {
        data() {
            return {
                aboutShow: false
            }
        },
        methods: {
            fileChosen() {
                console.log("file change")
                function humanFileSize(bytes) {
                    /* Converts bytes into human readable format */
                    var thresh = 1000;
                    if (Math.abs(bytes) < thresh) return bytes + ' B';
                    var units = ['kB', 'MB'];
                    var u = -1;
                    while (Math.abs(bytes) >= thresh && u < units.length - 1) {
                        bytes /= thresh;
                        ++u;
                    }
                    return bytes.toFixed(1) + units[u];
                }

                var file = document.getElementById('file-input').files[0];
                var file_name = `${file.name} (${humanFileSize(file.size)})`
                show("#file-name-wrap")
                setText("#file-name", file_name);
                if (file.size > 10 * 1024 * 1024) {
                    // error message
                    show("#error")
                    setText("#error", "Error: File exceeds max size of 10MB.")
                    return;
                }
                hide("#error")
                show("#upload-image", "inline-block");
                hide("#upload-choose-image")

                // Show uploaded image preview
                var fileReader = new FileReader();
                fileReader.readAsDataURL(file);
                fileReader.onload = function (event) {
                    show("#image-preview", "inline-block")
                    document.getElementById("image-preview").src = event.target.result;
                }
                document.getElementById("title-wrap").classList.add("up");
            },
            cancel() {
              /* Removes file upload */
                hide("#file-name-wrap");
                hide("#error");
                hide("#image-preview")
                hide("#upload-image");
                show("#upload-choose-image")
                document.getElementById("title-wrap").classList.remove("up")
                // document.getElementById("upload-container").classList.remove("up")
                document.getElementById('file-input').value = '';
            },
            initUpload() {
                grecaptcha.execute();

            },
            upload(recaptcha='none') {
                hide("#upload-image");
                show("#upload-message");
                hide("#error")
                var formData = new FormData()
                formData.append("image", document.getElementById('file-input').files[0]);
                formData.append("recaptcha", recaptcha);
                var this_ = this;
                // console.log(formData)
                axios.post("/api/paint", formData, {
                    headers: {
                        'Content-Type': 'multipart/form-data'
                    }
                }).then(function(resp) {
                    // console.log(resp)
                    if (resp.status !== 200) {
                        show("#error")
                        setText("#error", `Error: ${resp.data}`)
                        show("#upload-image", "inline-block");
                        hide("#upload-message");
                    }else {
                        var code = resp.data;
                        this_.$router.push({name: 'results', params: {id: code}});
                    }
                })
            }
        },
        mounted() {
            window.upload = this.upload;
            var recaptchaJS = document.createElement('script');
            recaptchaJS.src = "https://www.google.com/recaptcha/api.js";

            recaptchaJS.async = true;
            document.head.appendChild(recaptchaJS);
        }
    }
</script>

